import React from "react";

class ProjectDetails extends React.Component {
  constructor(props) {
    super(props);
    this.state = { idProject: this.props.idProject };
  }
  render() {
    return (
      <div class="container">
        <div class="row">
          <div class="col-8">col-8</div>
          <div class="col-4"><table class="table table-hover">
          <thead>
            <tr>
              <th scope="col">Id</th>
              <th scope="col">Nombre</th>
              <th scope="col">Inicio planeado</th>
              <th scope="col">F. Fin planeado</th>
              <th scope="col">F. Inicio real</th>
              <th scope="col">F. Fin real</th>
              <th scope="col">Prioridad</th>
              <th scope="col">Estado</th>
              <th scope="col">Detalles</th>
            </tr>
          </thead>
        </table></div>
        </div>
      </div>
    );
  }
}

export default ProjectDetails;
